import React, { useState, useEffect } from 'react';
import { Paper, Typography, Box, Button, IconButton, useMediaQuery, LinearProgress } from '@mui/material';
import WorkIcon from '@mui/icons-material/Work';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';
import theme from '../../theme';
import Chip from '@mui/material/Chip';
import { Link, useNavigate } from 'react-router-dom';
import SwipeableViews from 'react-swipeable-views';
import { autoPlay } from 'react-swipeable-views-utils';

const AutoPlaySwipeableViews = autoPlay(SwipeableViews);

interface WorkExperience {
  title: string;
  period: string;
  details: string;
  skills: string[];
  link: string;
}

const WorkExperienceComponent = () => {
  const navigate = useNavigate();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));
  const [activeStep, setActiveStep] = useState(0);
  const [completed, setCompleted] = useState(0);
  const transitionDuration = 5000; // Duration in milliseconds for auto-play and loading bar

  const workExperiences: WorkExperience[] = [
    {
      title: "XR Software Developer - Mohawk College",
      period: "Jan 2023 - Dec 2023",
      details: "Specializing in immersive virtual learning experiences using XR technologies. Key projects include a VR Water Channel Machine, Cell Tower Training Simulator, and an Interactive Car Industry Exhibit.",
      skills: ["C#", "Unity", "Unreal Engine", "Blender", "Git"],
      link: "/XRDeveloper",
    },
    {
      title: "Automation Assistant - Mohawk College",
      period: "September 2022 - December 2022",
      details: "As an automation assistant for the manager of funding proposals within the colleges research department, I was tasked with developing an application to automate the grant proposal creation process.",
      skills: ["Python", "Qt 6", "OpenAI", "httpx", "SQLite"],
      link: "/AutomationAssistant",
    },
  ];

  useEffect(() => {
    const timer = setInterval(() => {
      setCompleted((oldCompleted) => {
        if (oldCompleted === 100) {
          return 0;
        }
        const diff = 100 / (transitionDuration / 100); // Calculate progress increment
        return Math.min(oldCompleted + diff, 100);
      });
    }, 100); // Update progress every 100ms

    return () => {
      clearInterval(timer);
    };
  }, [transitionDuration]);

  useEffect(() => {
    const timer = setInterval(() => {
      setCompleted((oldCompleted) => {
        if (oldCompleted === 100) {
          setActiveStep((prevActiveStep) => (prevActiveStep + 1) % workExperiences.length);
          return 0;
        }
        return Math.min(oldCompleted + (100 * 100 / transitionDuration), 100); // Synchronize with slide duration
      });
    }, 100); // Update every 100ms

    return () => {
      clearInterval(timer);
    };
  }, [transitionDuration, workExperiences.length]);

  const handleBack = () => {
    navigate(-1);
  };
  const renderWorkExperience = (experience: WorkExperience) => {
    return (
      <Paper elevation={3} sx={{ m: { xs: 2, sm: 5 }, p: { xs: 2, sm: 5 } }}>
        <Box display="flex" flexDirection="column" alignItems="center">
          <WorkIcon sx={{ marginRight: 1 }} />
          <Typography variant="h5" textAlign="center">{experience.title}</Typography>
        </Box>
        <Typography variant="body1" gutterBottom>
          {experience.period}
        </Typography>
        <Box sx={{ my: 2 }}>
          {experience.skills.map((skill, index) => (
            <Chip label={skill} key={index} color="primary" variant="outlined" sx={{ mr: 1, mb: 1 }} />
          ))}
        </Box>
        <Typography variant="body2" sx={{ padding: 2 }}>
          {experience.details}
        </Typography>
        <Button component={Link} to={experience.link} variant="outlined" color="primary" sx={{ marginTop: 1 }}>
          More Details
        </Button>
      </Paper>
    );
  };

  return (
    <Box sx={{
      flexGrow: 1,
      pt: { xs: 7, sm: 3 },
      pb: { xs: 2, sm: 3 },
      backgroundColor: theme.palette.background.default,
      maxWidth: { sm: '689px', xs: '100%' },
      mx: 'auto',
    }}>
      <IconButton onClick={handleBack} sx={{ position: 'absolute', top: 20, left: 20, zIndex: 1 }}>
        <ArrowBackIcon />
      </IconButton>

      {isMobile ? (
        <>
          <AutoPlaySwipeableViews
            index={activeStep}
            onChangeIndex={(step: number) => setActiveStep(step)}
            interval={transitionDuration}
            springConfig={{ duration: '1s' }} // Longer transition animation
          >
            {workExperiences.map((experience, index) => (
              <div key={index}>{renderWorkExperience(experience)}</div>
            ))}
          </AutoPlaySwipeableViews>
          <LinearProgress 
            variant="determinate" 
            value={completed} 
            sx={{ mt: 1, mx: 3, height: 6 }} // Adjusted style
          />
        </>
      ) : (
        workExperiences.map((experience, index) => (
          <div key={index}>{renderWorkExperience(experience)}</div>
        ))
      )}
    </Box>
  );
};

export default WorkExperienceComponent;
